class District extends Realm.Object {}
 District.schema ={
    name: "District",
    properties :{
        DISTRICT_ID :'int?',
        DISTRICT_VALUE: 'int?',
        DISTRICT_NAME: 'string',
        PROVINCE_ID: 'int?',
        VALUE: 'string'
    }
 }
  
 export default new Realm({schema:[District]})
